import React from "react";
import ReactDOM from "react-dom";
import { withRouter } from "react-router-dom";
import ToolbarData from "./toolbar.json";
import ResponsiveNavbar from "@opuscapita/react-responsive-navbar";

const items = (props) => {
  const url = window.location.href.split("/").pop();
  const vals = Object.keys(ToolbarData);
  for (var i = 0; i < vals.length; i++) {
    if (vals[i] === url) {
      const list = vals[i];
      const item = Object.values(ToolbarData[list]);
      console.log(item);
      return item;
    }
  }
};
const ResponsiveNavbarView = (props) => {
  const activeKey = 2;
  return (
    <ResponsiveNavbar
      activeKey={activeKey}
      list={items}
      onSelect={(href) => {
        props.router.push(href);
      }}
    />
  );
};

export default withRouter(ResponsiveNavbarView);
